import React from 'react';

function TitleBlock() {
    return (
        <div className="jumbotron mt-3 border">
            <div className="container">
                <h1 className="display-4 d-flex justify-content-center">Google Books Search</h1>
                <p className="lead d-flex justify-content-center">Search for and Save Books of Interest</p>
            </div>
        </div>
    )
}

export default TitleBlock;
